import React from 'react';

export default function TimanttiTitle() {
  return <div>

      <h3 className="secondBar">PÄIVÄN TIMANTTI: Tutkija kertoo: Näin sota näkyy Putinin silmissä</h3>
      <h3 className="secondBar">PÄIVÄN TIMANTTI: Harriet Rabb tajusi avioliiton taloudelliset hyödyt ilman avioehtoa</h3>
      <h3 className="thirdBar">MAINOS: Faktat on uusi fiktio - tutustu Hesariin tuplamaksulla!</h3>
  </div>;
}
